package com.ashref.denden.pfe.backend.domain.business;

public class SerialBusiness {
	
	private Long id;
	
	private String serial;
	
	private String uid;
	
	private Integer checkNumb;
	
	public SerialBusiness() {
		// TODO Auto-generated constructor stub
	}

	public Long getId() {
		return id;
	}

	public void setId(Long id) {
		this.id = id;
	}

	public String getSerial() {
		return serial;
	}

	public void setSerial(String serial) {
		this.serial = serial;
	}

	public String getUid() {
		return uid;
	}

	public void setUid(String uid) {
		this.uid = uid;
	}

	public Integer getCheckNumb() {
		return checkNumb;
	}

	public void setCheckNumb(Integer checkNumb) {
		this.checkNumb = checkNumb;
	}
	

}
